import React, { useState, useEffect } from 'react';
import {
  Container,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
  Box,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  CircularProgress,
  Chip
} from '@mui/material';
import axios from 'axios';

function Orders({ user }) {
  const [orders, setOrders] = useState([]);
  const [error, setError] = useState('');
  const [openDialog, setOpenDialog] = useState(false);
  const [newOrder, setNewOrder] = useState({
    pid: '',
    quantity: '',
  });

  useEffect(() => {
    fetchOrders();
  }, [user]);

  const fetchOrders = async () => {
    try {
      const response = await axios.get(`http://localhost:5000/api/orders/${user.uid}`);
      setOrders(response.data);
    } catch (err) {
      console.error('Error fetching orders:', err);
      setError(err.response?.data?.error || 'Failed to fetch orders');
    }
  };

  const handlePlaceOrder = async () => {
    try {
      // Validate inputs
      if (!newOrder.pid || !newOrder.quantity) {
        setError('Please fill in all fields');
        return;
      }

      if (parseInt(newOrder.quantity) <= 0) {
        setError('Quantity must be greater than 0');
        return;
      }

      const response = await axios.post('http://localhost:5000/api/orders', {
        pid: parseInt(newOrder.pid),
        uid: user.uid,
        quantity: parseInt(newOrder.quantity)
      });

      console.log('Order response:', response.data);
      setOpenDialog(false);
      setError('');
      fetchOrders();
      setNewOrder({ pid: '', quantity: '' });
    } catch (err) {
      console.error('Error placing order:', err);
      setError(err.response?.data?.error || 'Failed to place order');
    }
  };

  return (
    <Container>
      <Box mt={4}>
        <Box display="flex" justifyContent="space-between" alignItems="center" mb={3}>
          <Typography variant="h4">
            Orders
          </Typography>
          <Button
            variant="contained"
            color="primary"
            onClick={() => {
              setError('');
              setOpenDialog(true);
            }}
          >
            Place New Order
          </Button>
        </Box>

        {error && (
          <Paper style={{ padding: '10px', marginBottom: '20px', backgroundColor: '#ffebee' }}>
            <Typography color="error">{error}</Typography>
          </Paper>
        )}

        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Order ID</TableCell>
                <TableCell>Product ID</TableCell>
                <TableCell>Quantity</TableCell>
                <TableCell>Status</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {orders.map((order) => (
                <TableRow key={order.orderid}>
                  <TableCell>{order.orderid}</TableCell>
                  <TableCell>{order.pid}</TableCell>
                  <TableCell>{order.quantity}</TableCell>
                  <TableCell>{order.status || 'Pending'}</TableCell>
                </TableRow>
              ))}
              {orders.length === 0 && (
                <TableRow>
                  <TableCell colSpan={4} align="center">
                    No orders found
                  </TableCell>
                </TableRow>
              )}
            </TableBody>
          </Table>
        </TableContainer>

        <Dialog 
          open={openDialog} 
          onClose={() => {
            setError('');
            setOpenDialog(false);
          }}
        >
          <DialogTitle>Place New Order</DialogTitle>
          <DialogContent>
            {error && (
              <Typography color="error" style={{ marginBottom: '10px' }}>
                {error}
              </Typography>
            )}
            <TextField
              autoFocus
              margin="dense"
              label="Product ID"
              type="number"
              fullWidth
              value={newOrder.pid}
              onChange={(e) => {
                setError('');
                setNewOrder({ ...newOrder, pid: e.target.value });
              }}
            />
            <TextField
              margin="dense"
              label="Quantity"
              type="number"
              fullWidth
              value={newOrder.quantity}
              onChange={(e) => {
                setError('');
                setNewOrder({ ...newOrder, quantity: e.target.value });
              }}
            />
          </DialogContent>
          <DialogActions>
            <Button onClick={() => {
              setError('');
              setOpenDialog(false);
            }} color="primary">
              Cancel
            </Button>
            <Button onClick={handlePlaceOrder} color="primary" variant="contained">
              Place Order
            </Button>
          </DialogActions>
        </Dialog>
      </Box>
    </Container>
  );
}

export default Orders;
